import React from 'react'
import { Pagination } from 'react-bootstrap'
import { LinkContainer } from 'react-router-bootstrap'

function Paginate({pages}) {

   

    return (
        <Pagination>
            {pages.map((x) => (
                <LinkContainer
                    key={x + 1}
                    
                >
                    <Pagination.Item
                        active={x + 1 === page}
                    >
                        {x + 1}
                    </Pagination.Item>

                </LinkContainer>
            ))}
        </Pagination>
    )
}

export default Paginate
